import React from 'react';
import './App.css';
import logout from './logout.svg';
import { useNavigate } from 'react-router-dom';

function Home() {
    const navigate = useNavigate();

    const Header = () => {
        const HandleLogout = () => {
            alert('Logging out');
            navigate('/login');
        };

        return (
            <header className="header">
                <nav className="nav-links">
                    <a href="#">Home</a>
                    <a href="#">About Us</a>
                    <a href="#">Refresh</a>
                    <a href="#">Performance</a>
                    <a href="#">Report Bug</a>
                </nav>
                <div className="logout-button" onClick={HandleLogout}>
                    <svg
                        xmlns="http://www.w3.org/2000/svg"
                        viewBox="0 0 24 24"
                        fill="none"
                        stroke="currentColor"
                        strokeWidth="2"
                        strokeLinecap="round"
                        strokeLinejoin="round"
                        className="logout-icon"
                    >
                        <path d="M9 21H5a2 2 0 0 1-2-2V5a2 2 0 0 1 2-2h4" />
                        <polyline points="16 17 21 12 16 7" />
                        <line x1="21" y1="12" x2="9" y2="12" />
                    </svg>
                </div>
            </header>
        );
    };

    const MainContent = () => (
        <main className="main-content">
            <Method />
            <UserInfo />
            <TaggingSection />
            <TagList />
        </main>
    );

    const Method = () => (
        <div className="tagging-section">
            <div>
                <label>Method</label>
                <select onChange={(event) => navigate(event.target.value)}>
                    <option value="/home">Part Of Speech (POS)</option>
                    <option value="/namedannotation">Named Entity Recognition (NER)</option>
                    <option value="/sentimental">Sentimental Analysis</option>
                </select>
            </div>
        </div>
    );

    const UserInfo = () => (
        <div className="user-info">
            <p>Current User: Siaesh Gaonkar</p>
        </div>
    );

    const TaggingSection = () => (
        <div className="tagging-section">
            <div className="tagging-header">
                <div>
                    <label>Language</label>
                    <select>
                        <option>Konkani</option>
                        <option>English</option>
                        <option>Hindi</option>
                    </select>
                </div>
                <div>
                    <label>Method</label>
                    <select>
                        <option>CLIFT NER</option>
                        <option>Method 2</option>
                    </select>
                </div>
            </div>
            <div className="textareas">
                <textarea className="text-1">
                    Lorem ipsum dolor sit amet consectetur adipisicing elit...
                </textarea>
            </div>
            <div className="textareas">
                <textarea className="text-1">
                    Lorem ipsum, dolor sit amet consectetur adipisicing elit...
                </textarea>
            </div>
            <div className="buttons">
                <button>Clear Tag</button>
                <button>Preview</button>
                <button>Next</button>
                <button className="tag-sentence">Tag Sentence</button>
                <button className="save">Save</button>
            </div>
        </div>
    );

    const TagList = () => {
        const tags = [
            { text: 'Person', color: 'tag-green' },
            { text: 'Noun', color: 'tag-blue' },
            { text: 'Festival', color: 'tag-orange' },
            { text: 'Language', color: 'tag-red' },
            { text: 'Religion', color: 'tag-teal' },
            { text: 'Game', color: 'tag-yellow' },
        ];

        return (
            <div className="tag-list">
                <p>Tag legends</p>
                <div className="tags">
                    {tags.map((tag, index) => (
                        <span key={index} className={`tag ${tag.color}`}>
                            {tag.text}
                        </span>
                    ))}
                </div>
            </div>
        );
    };

    return (
        <div className="container">
            <Header />
            <MainContent />
        </div>
    );
}

export default Home;
